import React from 'react'
import Button from "../Button/Button"
import style from "./Navbar.module.css"

export const Navbar = () => {
  return (
    <nav className={style.navbar}>
      <Logo/>
      <Button child="Give Feedback"/>
    </nav>
  )
}
